const Card = () => {
  return (
    <div className="card">
      <div className="top">
        <div className="circle-img"></div>
        <div className="name">
          <img src="image.jpg" alt="Profile" className="card-img" />
          <span>General Physician</span>
        </div>
      </div>
      <div className="bottom">
        {/* Content for the bottom section */}
      </div>
    </div>
  );
};
